#include <iostream>
#include <vector>
#include <algorithm>
#include <string>
using namespace std;

class Solution {
public:
    bool explore(const vector<vector<char>>& grid, int row, int col, vector<vector<int>>& visited)
    {
        const bool rowInbounds = row >= 0 && row < grid.size();
        const bool colInbounds = col >= 0 && col < grid.front().size();
        if (!rowInbounds || !colInbounds)
            return false;

        vector<int> currentNode = { row, col };
        if (find(visited.begin(), visited.end(), currentNode) != visited.end())
            return false;


        visited.push_back(currentNode);

        if (grid.at(row).at(col) == '0')
            return false;


        explore(grid, row - 1, col, visited);
        explore(grid, row + 1, col, visited);
        explore(grid, row, col - 1, visited);
        explore(grid, row, col + 1, visited);

        return true;
    }

    int numIslands(vector<vector<char>>& grid) {
        const auto rows = grid.size();
        const auto columns = grid.front().size();
        vector<vector<int>> visited;
		visited.reserve(rows * columns);
        auto count = 0;

        for (int row = 0; row < rows; ++row)
        {
            for (int col = 0; col < columns; ++col)
            {
                if (explore(grid, row, col, visited) == true)
                    ++count;
            }
        }
        return count;
    }
};
